import React, { useState } from "react";
import Header from "./components/Header";
import CourseForm from "./components/CourseForm";
import CourseList from "./components/CourseList";
import ScheduleTable from "./components/ScheduleTable";
import Footer from "./components/Footer";

function App() {
    const [courses, setCourses] = useState([]);
    const [forceList, setForceList] = useState([]);
    const [schedule, setSchedule] = useState([]);
    const [allSchedules, setAllSchedules] = useState([]);
    const [currentSchedule, setCurrentSchedule] = useState(0);
    const [min, setMin] = useState(2); // Default minimum courses
    const [max, setMax] = useState(4); // Default maximum courses
    const [term, setTerm] = useState("2024"); // Default term
    const [quarter, setQuarter] = useState("40"); // Default quarter (Fall)
    const [errorMessage, setErrorMessage] = useState("");

    const handleAddCourse = (courseName, section) => {
        if (
            courses.some((course) => course.name === `${courseName} ${section}`)
        ) {
            return false;
        }

        const newCourse = {
            name: `${courseName} ${section}`,
            forced: false,
        };

        setCourses([...courses, newCourse]);
        return true;
    };

    const handleRemoveCourse = (courseName) => {
        setCourses(courses.filter((course) => course.name !== courseName));
        setForceList(forceList.filter((course) => course !== courseName));
    };

    const handleToggleForce = (courseName) => {
        setCourses(
            courses.map((course) =>
                course.name === courseName
                    ? { ...course, forced: !course.forced }
                    : course
            )
        );
        if (forceList.includes(courseName)) {
            setForceList(forceList.filter((course) => course !== courseName));
        } else {
            setForceList([...forceList, courseName]);
        }
    };

    const generateJSON = () => {
        if (courses.length < min) {
            setErrorMessage(
                "Cannot have less courses than minimum courses in a schedule."
            );
            return;
        }

        if (forceList.length > max) {
            setErrorMessage(
                "Cannot have more forced courses than maximum courses in a schedule."
            );
            return;
        }

        const scheduleinfo = {
            courses: courses.map((course) => course.name),
            force: forceList,
            min: min,
            max: max,
            term: term + quarter,
        };

        setSchedule(scheduleinfo);
        const json = JSON.stringify(scheduleinfo);
        console.log(json);

        fetch("/schedule-optimizer", {
            method: "POST",
            headers: {
                "Content-Type": "application/json",
            },
            body: json,
        })
            .then((response) => response.json())
            .then((response) => {
                console.log(response);
                if (response.errors && response.errors.length > 0) {
                    setErrorMessage(response.errors.join("<br>"));
                    if (response.warnings && response.warnings.length > 0) {
                        setErrorMessage(
                            (prev) =>
                                prev + "<br>" + response.warnings.join("<br>")
                        );
                    }
                } else {
                    if (response.warnings && response.warnings.length > 0) {
                        setErrorMessage(response.warnings.join("<br>"));
                    }
                    setAllSchedules(response.schedules);
                    sortSchedules(response.schedules);
                    setCurrentSchedule(0);
                    displaySchedule(response.schedules[0]);
                }
            })
            .catch((error) => {
                console.error("Error:", error);
            });
    };

    const sortSchedules = (schedules) => {
        if (schedules.length <= 0) return;

        const sortValue = document.getElementById("scheduleSort").value;

        schedules.sort((a, b) => {
            if (sortValue === "score") {
                return b.score - a.score;
            } else if (sortValue === "end") {
                return b.weights.end - a.weights.end;
            } else if (sortValue === "gap") {
                return b.weights.gap - a.weights.gap;
            } else if (sortValue === "gpa") {
                return b.weights.gpa - a.weights.gpa;
            } else if (sortValue === "start") {
                return b.weights.start - a.weights.start;
            }
            return 0;
        });
    };

    return (
        <div className="App">
            <Header />
            <div className="container">
                <CourseForm onAddCourse={handleAddCourse} />
                <CourseList
                    courses={courses}
                    onRemoveCourse={handleRemoveCourse}
                    onToggleForce={handleToggleForce}
                />
                <button onClick={generateJSON}>Submit</button>
                {errorMessage && (
                    <div id="errorMessage" style={{ color: "red" }}>
                        {errorMessage}
                    </div>
                )}
                <ScheduleTable
                    schedule={schedule}
                    currentSchedule={currentSchedule}
                    displaySchedule={addCoursesToCalendar}
                    clearSchedule={clearSchedule}
                />
            </div>
            <Footer />
        </div>
    );
}

export default App;
